  `group` int(11) NOT NULL,
  `key` bigint(20) NOT NULL COMMENT 'key=(layer1*10+position1)*10 + (layer2*10+position2) ....',
  `modal` tinyint(4) NOT NULL DEFAULT '0' COMMENT '模型类型 0：线性回归 1：DNN 2：线性回归+DNN',
